import React, {Component} from 'react';

class Order extends Component {
    state = {...this.props.order, isClosed : true}

    handleClick= (event) => {
        this.setState({
            isClosed: !this.state.isClosed,
        })
    }
    render() { 
        return ( 
            <div className="order" key={this.state.id}>
                <p><span>NAME:</span>{this.state.name} <span class="material-icons-outlined" onClick={this.handleClick}>expand_less</span></p>
                <div className={this.state.isClosed ? "hidden" : "shown"}>
                    <p><span>ADDRESS:</span>{this.state.address}</p>
                    <p><span>SELECT PACK:</span>{this.state.pack}</p>
                    <p><span>PHONE NUMBER:</span>{this.state.number}</p>
                    <p><span>DELIVERY DATE:</span>{this.state.date}</p>
                </div>
                
            </div>
         );
    }
}
 
export default Order;
